X = log(S);
dateS = dateS+693960;

dateTime= datetime(datestr(dateS));

figure(1)
plot(dateTime,S,'linewidth',1.5)
grid on
hold on

xlabel('time')
ylabel('S(t)')

% Maximum Likelihood Estimation for mu

dt = 1; 
m  = length(dateS);
mu = 1/(m*dt)*(X(end)-X(1))

% Maximum Likelihood Estimation for sigma

s = 0;
for i=1:length(X)-1
    s = (X(i+1)-X(i)-mu*dt)^2;
end
sigma = sqrt(s/(m*dt))

% Monte Carlo simulation -- Forecasting

NoOfPaths    = 10;  % Plot 10 paths
NoOfSteps    = 160; % For approx. 0.5 year

Z            = random('normal',0,1,[NoOfPaths,NoOfSteps]);
Xsim         = zeros(NoOfPaths,NoOfSteps);
Xsim(:,1)    = log(S(end));

for i=1:NoOfSteps
    Z(:,i)         = (Z(:,i)-mean(Z(:,i)))/std(Z(:,i));
    Xsim(:,i+1)    = Xsim(:,i) + mu*dt + sigma*sqrt(dt)*Z(:,i);
end

figure(2)
plot(dateTime,S,'linewidth',1.5)
grid on; hold on

xlabel('time')
ylabel('S(t)')
dateGrid = dateTime(end) + caldays(0:NoOfSteps);
plot(dateGrid,exp(Xsim(:,:)),'-r','linewidth',1.5)
